      <View style={styles.textHeader}>
      <Text style={styles.text}>Cart</Text>
    </View>
    <View style={styles.listitem}>
     
    </View>
    </View>
  );
};

// define your styles
const styles = StyleSheet.create({
  container: {
    flex: 1,
   
  
